import React from 'react';

class AssignmentDashboard extends React.Component{
	render(){
		return(
			<div className='assignment-dashboard'>
				<div className='row'>
					<div className='col'>
						<h5>Due Date</h5>
					</div>
					<div className='col'>
						<h5>Name</h5>
					</div>
					<div className='col'>
						<h5>Class</h5>
					</div>
					<div className='col'>
						<button>+</button>
					</div>
				</div>
				<hr/>
			</div>	
		);
	}
}

class Assignment extends React.Component{
	render(){
		return(
			<div className='assignment'>
				<div className='row'>
					<div className='col'>
						{this.props.dueDate}
					</div>
					<div className='col'>
						{this.props.name}
					</div>
					<div className='col'>
						{this.props.class}
					</div>
					<div className='col'>
						<button>+</button>
					</div>
				</div>
			</div>
		);
	}
}

export default AssignmentDashboard;
